query:
INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, '6110', 'Standard Drug and Equipment List - BLS/LALS/ALS', 'Equipment', 'Each ambulance and first responder unit shall be equipped with functional equipment and supplies. This list represents mandatory items with minimum quantities excluding narcotics.', 'https://icema.sbcounty.gov/wp-content/uploads/sites/100/11.01.25-Policy-Manual.pdf', NOW()
FROM counties c WHERE c.name = 'Inland Counties EMS Agency' AND c.state = 'California' LIMIT 1;

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, '14060', 'Burns - Adult', 'Treatment Protocols', 'Burn patient requires effective communication and rapid transportation. Stop burning process, remove clothing and jewelry, keep patient warm. Estimate TBSA using Rule of Nines. Thermal burns: cover with dry sterile dressing. Chemical burns: brush off dry powder, irrigate with copious saline/water.', 'https://icema.sbcounty.gov/wp-content/uploads/sites/100/11.01.25-Policy-Manual.pdf', NOW()
FROM counties c WHERE c.name = 'Inland Counties EMS Agency' AND c.state = 'California' LIMIT 1;

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, '14070', 'Stroke Treatment - Adult', 'Treatment Protocols', 'Patient exhibiting signs/symptoms of stroke: speech disturbances, altered LOC, paresthesias, new onset seizures, dizziness, unilateral weakness, visual disturbances. Perform Cincinnati Stroke Scale. Document last known well time. Blood glucose check. Transport to stroke center.', 'https://icema.sbcounty.gov/wp-content/uploads/sites/100/11.01.25-Policy-Manual.pdf', NOW()
FROM counties c WHERE c.name = 'Inland Counties EMS Agency' AND c.state = 'California' LIMIT 1;

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, '14180', 'Burns - Pediatric', 'Treatment Protocols', 'Any burn patient requires effective communication and rapid transportation. In pediatric patients, use Lund-Browder chart for TBSA estimation. IV access with warm fluids. Consider pain management.', 'https://icema.sbcounty.gov/wp-content/uploads/sites/100/11.01.25-Policy-Manual.pdf', NOW()
FROM counties c WHERE c.name = 'Inland Counties EMS Agency' AND c.state = 'California' LIMIT 1;

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, '14010', 'Cardiac Arrest - Adult', 'Treatment Protocols', 'Begin CPR immediately. Attach AED/monitor. Analyze rhythm. VF/VT: Defibrillate 200J biphasic. Resume CPR 2 minutes. IV/IO access. Epinephrine 1mg IV/IO every 3-5 minutes. Amiodarone 300mg IV/IO for refractory VF/VT.', 'https://icema.sbcounty.gov/wp-content/uploads/sites/100/11.01.25-Policy-Manual.pdf', NOW()
FROM counties c WHERE c.name = 'Inland Counties EMS Agency' AND c.state = 'California' LIMIT 1;

